import "./post.css";

export default function Post() {
  return (
    <div className="post">
      <div className="postWrapper">
              <div className="postTop">
                  <div className="postTopLeft">
                      <img src="/asset" alt="" />
                  </div>
                  <div className="postTopRight"></div>
              </div>
              <div className="psotCenter"></div>
              <div className="postBottom"></div>

      </div>
    </div>
  );
}
